❓What is your favourite Nintendo Switch game❓
.
I don't have many games on the Nintendo Switch so I don't play it as much as I'd like. I got part way through Lost Sphear a while back and left it, but I've now picked it up from where I left off. .
I'm a huge fan of JRPGs and I really enjoyed my time with I Am Setsuna so I was excited when Lost Sphear came out. While Lost Sphear has wonderful environments, I preferred the characters and development in I Am Setsuna. I recommend these to JRPG fans!
